const Pictures = ({ pictures }) => {
//  console.log({objects.near_earth_objects[1]});
return (
<div>
  <center><h1>NASA: Astronomy Picture of the Day</h1></center>
  {
    <div class="card">
      <div class="card-body">
      <h5 classs="card-title">{pictures.title}</h5>
      <h6 class="card-subtitle mb-2 text-muted">{pictures.date}</h6>
      <img src={pictures.url} class="rounded mx-auto d-block"/>
      <div>
        <p class="card-text mx-auto mt-3">{pictures.explanation}</p>
      </div>

      </div>
    </div>
  }
</div>
)
};

export default Pictures
